import './App.css';
import Image from './Image.js';

function App() {
  return (
    <div>
    <Image source = 'https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.nationalgeographic.com%2Fanimals%2Fmammals%2Ffacts%2Fdomestic-cat&psig=AOvVaw33nvFn7On2XsZsPDYtPeYN&ust=1645207101144000&source=images&cd=vfe&ved=0CAsQjRxqFwoTCIiq1Jioh_YCFQAAAAAdAAAAABAD' alternativeText = 'Cat starring img'/>
    </div>
  );
}

export default App;
